description:
Rehearsal Demo Nov 11 2011 was recorded by Sunn O))) at Southern Lord Caves in Los Angeles on November 11, 2011. It was mixed at 10 R. D. Montiboeufs in Paris, January 12, and was mastered by Brad Boatright. This album was a split release by Ideologic Organ &amp; Southern Lord Recordings and was an edition of 1,500 copies on black vinyl. This album was only available on the band's June 2012 European tour and September 2012 US East Coast tour.

Tracklist: 

1. &quot;Holy Water&quot;  	 
2. &quot;Peacock Angel&quot;  	 
3. &quot;Power Nurse&quot;  

